   background-color: var(--text-primary);
}

::-webkit-scrollbar-thumb:hover {
   background-color: var(--text-dark);
}

body {
   font-family: "Inter", sans-serif;
   text-decoration: none;
   background: var(--background-image);
   height: 100%;
   background-position: center;
   background-repeat: no-repeat;
   background-size: cover;
   background-attachment: fixed;
}

::placeholder {
   color: var(--text-placeholder);
   opacity: 1;
}

.main {
   letter-spacing: 0px;
   font-family: "Inter", sans-serif;
   width: 99%;
   display: flex;
   flex-direction: column;
   justify-content: center;
   align-items: center;
   top: 0%;
   position: absolute;
   z-index: 99;
}
</style>
    <style>.column {
   width: 145px;
   transition: all 0.2s ease;
   cursor: pointer;
   background: var(--background-column);
   border-radius: 5px;
   padding-left: 10px;
   padding-right: 10px;
   padding-top: 5px;
   margin: 0;
}

.column img {
   position: absolute;
   width: 145px;
   height: 145px;
   border-radius: 0px;
   transition: all 0.2s ease;
   border-radius: 10px;
}

.column p {
   width: 145px;
   height: 19px;
   font-style: normal;
   font-weight: 800;
   font-size: 18px;
   line-height: 19px;
   text-align: center;
   color: var(--text-primary);
   text-shadow: 0px 0px 30px rgba(0, 0, 0, 0.5);
   padding-top: 136px;
   padding-bottom: 12px;
}

.column:hover {
   transform: scale(1.2);
}

.column:hover .label {
   transform: translateX(-50%) scale(1.3);
}

.container-apps {
   display: flex;
   flex-wrap: wrap;
   justify-content: center;
   gap: 2.3em;
   flex-direction: row;
   margin-top: 30px;
}

.pinned-apps {
   margin-top: 20px;
   display: flex;
   flex-wrap: wrap;
   justify-content: center;
   gap: 2.3em;
}

input {
   padding: 20px;
   width: 550px;
   border-radius: 5px;
   background: var(--background-column);
   text-align: center;
   font-size: 20px;
   border: none;
   outline: none;
   color: var(--text-primary);
   transition: 0.4s;
}

select {
   padding: 20px;
   border-radius: 5px;
   background: var(--background-column);
   color: var(--text-primary);
   font-size: 20px;
   border: 0px;
   outline: none;
   cursor: pointer;
}

.input-container {
   position: relative;
   margin-top: 150px;
   display: flex;
   flex-wrap: wrap;
   justify-content: center;
   gap: 0.5em;
}
</style>
    <style>.material-symbols-outlined {
   font-variation-settings: "FILL" 0, "wght" 400, "GRAD" 0, "opsz" 48;
}

.fixed-nav-bar #icon-container {
   display: flex;
   align-items: center;
}

img {
   width: 100%;
   height: 100%;
   padding-top: 5px;
}

.fixed-nav-bar-container {
   min-width: 5vw;
   min-height: 10vh;
   display: inline;
}

.fixed-nav-bar {
   top: 0;
   letter-spacing: 2px;
   font-size: 22px;
   left: 0;
   right: 0;
   min-height: 10vh;
   padding: 0 25px;
   box-sizing: border-box;
   background-color: var(--background-nav);
   box-shadow: 0 0 15px 2px rgba(0, 0, 0, 0.5);
   -webkit-backdrop-filter: var(--backdrop-filter);
   backdrop-filter: var(--backdrop-filter);
   transition: 0.35s ease;
   border-radius: 15px;
   width: fill;
   margin: 15px;
   z-index: 100;
   position: fixed;
}

.fixed-nav-bar .icon:hover {
   transform: translateY(-15%) scale(1.03);
   font-weight: 800;
}

.fixed-nav-bar .icon {
   position: absolute;
   float: left;
   text-transform: uppercase;
   font-size: 30px;
   font-family: "Inter", sans-serif;
   cursor: pointer;
   color: var(--text-primary);
   font-weight: 600;
   margin-left: 5px;
   font-style: normal;
   text-decoration: none;
   transition: all 0.2s ease;
   height: 5vh;
   top: 18%;
}

.fixed-nav-bar-right {
   position: absolute;
   top: 50%;
   transform: translateY(-50%);
   text-transform: uppercase;
   font-size: 18px;
   color: var(--text-primary);
   font-weight: 600;
   right: 2%;
}

.fixed-nav-bar-right .navbar-link {
   margin-left: 10px;
   text-transform: uppercase;
   cursor: pointer;
   color: var(--text-primary);
   font-weight: 800;
   right: 2%;
   font-family: "Inter", sans-serif;
   font-style: normal;
   text-decoration: none;
   transition: all 0.2s ease;
   transform: translateX(0%);
}

@media (orientation: portrait) {
   .fixed-nav-bar-right .navbar-link {
      margin-left: 10px;
      text-transform: uppercase;
      font-size: 2.5vw;
      cursor: pointer;
      color: var(--text-primary);
      font-weight: 800;
      right: 2%;
      font-family: "Inter", sans-serif;
      font-style: normal;
      text-decoration: none;
      transition: all 0.2s ease;
      transform: translateX(0%);
   }
   .fixed-nav-bar-right .navbar-link:hover {
      text-transform: uppercase;
      cursor: pointer;
      font-weight: 800;
      font-family: "Inter", sans-serif;
      font-style: normal;
      font-size: 3vw;
      transform: translateX(-20%);
   }
}

.fixed-nav-bar-right .navbar-link:hover {
   text-transform: uppercase;
   cursor: pointer;
   font-weight: 800;
   font-family: "Inter", sans-serif;
   font-style: normal;
   font-size: 3vh;
   transform: translateX(-20%);
}

.navbar-icon {
   margin-right: 5px;
   transition: all 0.2s ease;
}

.navbar-link {
   margin-right: 5px;
}

.navbar-link:hover > .settings-icon {
   animation: spin 0.5s;
   animation-timing-function: cubic-bezier(0, 1.04, 0.91, 0.99);
}

@media (max-width: 768px) {
   .fixed-nav-bar-right .navbar-link an {
      display: none;
   }
   .fixed-nav-bar-right .fa-solid {
      display: inline;
   }
   .fixed-nav-bar-right .navbar-link {
      font-size: 4.5vw;
   }
}

@keyframes spin {
   from {
      transform: rotate(0deg);
   }
   to {
      transform: rotate(360deg);
   }
}

@media (orientation: portrait) {
   img {
      height: 40px;
   }
}
</style>
    <style>body {
   background-color: var(--background-image);
   font-family: "Inter", sans-serif;
   color: var(--text-primary);
   margin: 0;
   padding: 0;
   letter-spacing: 0px;
   overflow-x: hidden;
}

.settings-container {
   display: flex;
   flex-wrap: wrap;
   justify-content: center;
   gap: 20px;
   padding: 20% 20px 20px 20px;
}

.settings-title {
   display: block;
   font-size: 70px;
   margin-block-start: 0.67em;
   margin-block-end: 0.67em;
   margin-inline-start: 0px;
   margin-inline-end: 0px;
   font-weight: bold;
}

.settings-card {
   background-color: var(--background-settings);
   border-radius: 10px;
   padding: 20px;
   box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
   width: 400px;
   transition: all 0.3s ease;
}

.settings-card:hover {
   transform: translatey(-5px);
   box-shadow: 0 8px 12px rgba(0, 0, 0, 0.2);
}

.settings-card h3 {
   margin-top: 0;
   color: var(--text-primary);
}

.settings-card p {
   color: var(--text-placeholder);
}

a {
   color: var(--text-primary);
}

.switch {
   position: relative;
   display: inline-block;
   width: 60px;
   height: 34px;
}

.switch input {
   opacity: 0;
   width: 0;
   height: 0;
}

.slider-round {
   position: absolute;
   cursor: pointer;
   top: 0;
   left: 0;
   right: 0;
   bottom: 0;
   background-color: var(--slider-inactive-background);
   transition: 0.4s;
   border-radius: 34px;
}

.slider-round:before {
   position: absolute;
   content: "";
   height: 26px;
   width: 26px;
   left: 4px;
   bottom: 4px;
   background-color: var(--text-primary);
   transition: 0.4s;
   border-radius: 50%;
}

input:checked + .slider-round {
   background-color: var(--slider-active-background);
}

input:checked + .slider-round:before {
   transform: translateX(26px);
}

input {
   padding: 15px;
   border-radius: 10px;
   background: var(--background-input);
   text-align: center;
   font-size: 20px;
   border: none;
   outline: none;
   color: var(--text-primary);
}

.key-form {
   padding: 15px;
   width: 92.5%;
   border-radius: 10px;
   background: var(--background-buttons);
   text-align: center;
   font-size: 20px;
   border: none;
   outline: none;
   color: var(--text-primary);
   margin-top: 10px;
}

.key-button {
   cursor: pointer;
   border: 2px;
   font-size: 20px;
   transition: 0.2s;
   margin-top: 10px;
   background-color: var(--background-buttons);
   padding: 0.5rem;
   border-radius: 10px;
   color: var(--text-primary);
   height: 50px;
   width: 50%;
   padding: 10px;
   text-align: center;
}

button {
   cursor: pointer;
   border: 2px;
   transition: 0.2s;
   margin-top: 10px;
   background-color: var(--background-buttons);
   padding: 0.5rem;
   border-radius: 10px;
   color: var(--text-primary);
   height: 50px;
   width: 35%;
   padding: 10px;
   text-align: center;
}

select {
   padding: 15px;
   width: 100%;
   border-radius: 10px;
   background: var(--background-buttons);
   color: var(--text-primary);
   font-size: 20px;
   border: 0px;
   outline: none;
}

#buttonLayer {
   width: 400px;
   display: flex;
   justify-content: center;
   gap: 10px;
}

#buttonLayer > .key-button {
   flex-grow: 1;
   padding: 10px;
   box-sizing: border-box;
}

@media screen and (max-width: 768px) {
   .settings-container {
      padding: 25% 20px 20px 20px;
   }
   .settings-card {
      width: 100%;
      max-width: 400px;
   }

   .settings-title {
      font-size: 40px;
   }

   input,
   .key-form {
      width: 90%;
   }

   button,
   .key-button {
      width: 100%;
      max-width: 200px;
   }
}

@media screen and (max-width: 500px) {
   .settings-container {
      padding-top: 35%;
   }
}

@media screen and (min-width: 1000px) {
   .settings-container {
      padding-top: 10%;
   }
}

#last-updated {
   margin-top: -3%;
}

#ab-settings {
   display: flex;
   align-items: center;
   gap: 5vw;
}

#ab-settings-container {
   margin-top: 13px;
   margin-left: 20px;
}
</style>

  font-family: 'Font Awesome 6 Duotone';
  font-weight: 900;
  letter-spacing: normal;
}

.fad::before,
.fa-duotone::before {
  position: absolute;
  color: var(--fa-primary-color, inherit);
  opacity: var(--fa-primary-opacity, 1);
}

.fad::after,
.fa-duotone::after {
  color: var(--fa-secondary-color, inherit);
  opacity: var(--fa-secondary-opacity, 0.4);
}

.fa-swap-opacity .fad::before,
.fa-swap-opacity .fa-duotone::before,
.fad.fa-swap-opacity::before,
.fa-duotone.fa-swap-opacity::before {
  opacity: var(--fa-secondary-opacity, 0.4);
}

.fa-swap-opacity .fad::after,
.fa-swap-opacity .fa-duotone::after,
.fad.fa-swap-opacity::after,
.fa-duotone.fa-swap-opacity::after {
  opacity: var(--fa-primary-opacity, 1);
}

.fad.fa-inverse,
.fa-duotone.fa-inverse {
  color: var(--fa-inverse, #fff);
}

.fad.fa-stack-1x,
.fad.fa-stack-2x,
.fa-duotone.fa-stack-1x,
.fa-duotone.fa-stack-2x {
  position: absolute;
}

.fad.fa-stack-1x::before,
.fa-duotone.fa-stack-1x::before,
.fad.fa-stack-2x::before,
.fa-duotone.fa-stack-2x::before,
.fad.fa-fw::before,
.fa-duotone.fa-fw::before {
  left: 50%;
  -webkit-transform: translateX(-50%);
  transform: translateX(-50%);
}

document.addEventListener("DOMContentLoaded", () => {
  const eventKey = JSON.parse(localStorage.getItem("eventKey")) || ["Ctrl", "E"];
  const pLink = localStorage.getItem("pLink") || "https://classroom.google.com/";
  let pressedKeys = [];

  document.addEventListener("keydown", event => {
    pressedKeys.push(event.key);
    if (pressedKeys.length > eventKey.length) {
      pressedKeys.shift();
    }
    if (eventKey.every((key, index) => key === pressedKeys[index])) {
      window.location.href = pLink;
      pressedKeys = [];
    }
  });
});

// Tab Cloaker
const dropdown = document.getElementById("dropdown");

// AB Cloak
function AB() {
  let inFrame;

  try {
    inFrame = window !== top;
  } catch (e) {
    inFrame = true;
  }

  if (!inFrame && !navigator.userAgent.includes("Firefox")) {
    const popup = open("about:blank", "_blank");
    if (!popup || popup.closed) {
      alert("Window blocked. Please allow popups for this site.");
    } else {
      const doc = popup.document;
      const iframe = doc.createElement("iframe");
      const style = iframe.style;
      const link = doc.createElement("link");

      const name = localStorage.getItem("name") || "My Drive - Google Drive";
      const icon =
        localStorage.getItem("icon") ||
        "https://ssl.gstatic.com/docs/doclist/images/drive_2022q3_32dp.png";

      doc.title = name;
      link.rel = "icon";
      link.href = icon;

      iframe.src = location.href;
      style.position = "fixed";
      style.top = style.bottom = style.left = style.right = 0;
      style.border = style.outline = "none";
      style.width = style.height = "100%";

      const pLink = localStorage.getItem(encodeURI("pLink")) || getRandomURL();
      location.replace(pLink);

      const script = doc.createElement("script");
      script.textContent = `
        window.onbeforeunload = function (event) {
          const confirmationMessage = 'Leave Site?';
          (event || window.event).returnValue = confirmationMessage;
          return confirmationMessage;
        };
      `;
      doc.head.appendChild(link);
      doc.body.appendChild(iframe);
      doc.head.appendChild(script);
    }
  }
}

  } else {
    localStorage.setItem("ab", "true");

}

function EngineChange(dropdown) {
  const selectedEngine = dropdown.value;

  const engineUrls = {
    Google: "https://www.google.com/search?q=",
    Bing: "https://www.bing.com/search?q=",
    DuckDuckGo: "https://duckduckgo.com/?q=",
    Qwant: "https://www.qwant.com/?q=",
    Startpage: "https://www.startpage.com/search?q=",
    SearchEncrypt: "https://www.searchencrypt.com/search/?q=",
    Ecosia: "https://www.ecosia.org/search?q=",
  };

  localStorage.setItem("engine", engineUrls[selectedEngine]);
  localStorage.setItem("enginename", selectedEngine);

  dropdown.value = selectedEngine;
}

function SaveEngine() {
  const customEngine = document.getElementById("engine-form").value;
  if (customEngine.trim() !== "") {
    localStorage.setItem("engine", customEngine);
    localStorage.setItem("enginename", "Custom");

    alert("Please enter a custom search engine value.");
  }
}

document.addEventListener("DOMContentLoaded", () => {
  const selectedEngineName = localStorage.getItem("enginename");
  const dropdown = document.getElementById("engine");
  if (selectedEngineName) {
    dropdown.value = selectedEngineName;
  }
});

function getRandomURL() {
  const randomURLS = [
    "https://kahoot.it",
    "https://classroom.google.com",
    "https://drive.google.com",
    "https://google.com",
    "https://docs.google.com",
    "https://slides.google.com",
    "https://www.nasa.gov",
    "https://blooket.com",
    "https://clever.com",
    "https://edpuzzle.com",
    "https://khanacademy.org",
    "https://wikipedia.org",
    "https://dictionary.com",
  ];
  return randomURLS[randRange(0, randomURLS.length)];
}

function randRange(min, max) {
  return Math.floor(Math.random() * (max - min) + min);
}
